function customizeSelect(e){var t=e.find("select");if(!t.length>0)return!1;t.each(function(){$(this).select2({width:"100%",minimumResultsForSearch:-1})})}function customizeCheckbox(e){var t=e.find("input[type='checkbox']");if(!t.length>0)return!1;t.each(function(){$(this).wrap("<span class='custom-checkbox' />").after('<span class="box"><span class="tick"></span></span>')})}$(document).ready(function(){customizeSelect($("#usersGrid .item")),customizeCheckbox($("#usersGrid .item"))});